    right: 0;
    left: 0;

    display: block;

    width:    -moz-fit-content;
    width: -webkit-fit-content;
    width:         fit-content;
    height:    -moz-fit-content;
    height: -webkit-fit-content;
    height:         fit-content;
    margin: auto;
    padding: 1em;

    color: black;
    border: solid;
    background-color: white;
}

dialog:not([open])
{
    display: none;
}

/*
 * Add the correct display in all browsers.
 */

