[aria-hidden='false'][hidden]:not(:focus)
{
    position: absolute;

    display: inherit;
    clip: rect(0, 0, 0, 0);
}

sources.App.scss:
// With Parcel, you have nothing to setup for SCSS, you just write!

@import './global/vars.scss';
@import './global/navStyles.scss';
@import './global/labelStyles.scss';
@import './global/reactModalMods.scss';
@import './global/antd.scss';
@import './global/antMods.scss';
@import './global/sanitize.scss';

.headingSz
{
  font-size: 3em;

}

body
{
    overflow-x: hidden;

    max-width: 100vw;
    min-height: 100vh;
    margin: 0 auto;

    color: $richer;
    background-color: $darkTint;
    background-image: url($logo);
    background-repeat: no-repeat;
    background-attachment: fixed;
    background-position: center;
    background-size: cover;
}

a
{
    transition: all 1s ease-in-out;
    text-decoration: none;

    color: $light;

    &:hover,
    &:focus,
    &:visited,
    &:active
    {
        transition: all .5s ease-in-out;

        opacity: .8;
        color: $richer;
        border: 0;
        box-shadow: $transparent;
    }
}

.rad-6
{
    border-radius: 60%;
}

.p4
{
    padding: 4em;
}

.centerTxt
{
    justify-content: center;

    text-align: center;
}

.centerMargin
{
    margin: 0 auto;
}
.fluid
{
    width: 100%;

    object-fit: cover;
    object-position: center;
}
.b-radius-1
{
    border-radius: 50em;
}
.bannerize
{
    height: 40vh;
}

.logo-bg
{
    background-image: url($logo);
    background-repeat: no-repeat;
    background-attachment: fixed;
    background-position: center;
    background-size: cover;
}

.tint-bg
{
    align-content: center;

    min-width: 100vw;
    min-height: 100vh;

    background-color: rgba($dark, .8);
}
